        dct:description  "Teknisk beskrivelse av REST-tjenestene i √Öpne Data fra Enhetsregisteret - Work in progress\n---\n\n## Ordbok\n### Enhetsregisteret\nRegister over grunndata om juridiske personer og andre enheter. Enhetsregisteret tildeler organisasjonsnummer for entydig identifisering av enheter.\n\n### Organisasjonsnummer\nNisifret nummer som entydig identifiserer enheter i Enhetsregisteret.\n\n### Enhet\nEnhet p√• √∏verste niv√• i registreringsstrukturen i Enhetsregisteret. Eksempelvis enkeltpersonforetak, foreninger, selskap, sameier og andre som er registrert i Enhetsregisteret. Identifiseres med organisasjonsnummer.\n\n### Underenhet\nEnhet p√• laveste niv√• i registreringsstrukturen i Enhetsregisteret. En underenhet kan ikke eksistere alene og har alltid knytning til en hovedenhet. Identifiseres med organisasjonsnummer.\n\n### Organisasjonsform\nOrganisasjonsform er virksomhetens formelle organisering og gir retningslinjer overfor blant annet ansvarsforhold, skatt, revisjonsplikt, rettigheter og plikter.\n\n### N√¶ringskode\n[N√¶ringskoder]: https://www.brreg.no/bedrift/naeringskoder/\n[N√¶ringskoder]  p√• brreg.no\n\n[Standard for n√¶ringsgruppering]: https://www.ssb.no/klass/klassifikasjoner/6\n[Standard for n√¶ringsgruppering]\n---\n\n## Versjonering\nDu kan velge major versjon ved √• spesifisere HTTP Accept-headeren. Bruk headeren spesifisert i tabellen under. Hvis versjon ikke spesifiseres, vil man f√• siste versjon.\n\n  \n    \n      API\n      Header\n    \n  \n  \n    \n      /\n      application/vnd.enhetsregisteret.v1+json\n    \n    \n      /organisasjonsformer\n      application/vnd.enhetsregisteret.organisasjonsform.v1+json\n    \n  \n\n\n\n### Strategi\nVi skal normalt ikke bryte bakoverkompabiliteten med v√•re brukere. Likevel kan det v√¶re n√∏dvendig i enkelte situasjoner, av for eksempel juridiske √•rsaker eller vedlikehold, √• gj√∏re endringer som medf√∏rer et slikt brudd. Vi vil i dette tilfellet versjonere tjenesten slik at nyeste versjon vil v√¶re tilgjengelig sammen med forrige versjon.\n\n#### Dersom man ikke benytter versjonering i accept header, vil man f√• siste versjon.\n\nEldre versjon vil anses som utdatert/deprecated, og vil p√• sikt bli tatt bort. Ved behov for denne typen endringer vil vi fors√∏ke √• gi bruker god tid, og varsle om endringen i forkant. Se punkt om varsling.\n\n### N√•r innf√∏res ny versjon\nVi vil innf√∏re en ny versjon n√•r vi introduserer en endring som p√•virker bakoverkompabiliteten. Mindre endringer og patcher vil ikke medf√∏re versjonsendring i header.\n\n### N√•r fjernes en versjon\nVi vil legge ut varsel/driftsmeldinger i god tid p√• f√∏lgende steder:\n- [Driftsmeldinger]: https://www.brreg.no/om-oss/driftsmeldinger/\n[Driftsmeldinger]\n- [RSS-feed]: https://www.brreg.no/produkter-og-tjenester/rss-feed/\n[RSS-feed].\n\nEksempel p√• endring som medf√∏rer versjonering:\n\n- Fjerne eller endre navn p√• et attributt i HTTP-responsen.\n\n- Fjerne eller endre navn p√• et REST endepunkt.\n\n---\n\n## Endringslogg\n\n  \n    \n      Versjon\n      Dato\n      Endring\n    \n  \n  \n    \n      1.1.0\n      14. august 2018\n      Ny tjeneste /oppdateringer/enheter og /oppdateringer/underenheter\n    \n    \n      1.0.0\n      6. april 2018\n      Produksjonssetting av ny √•pne data tjeneste for Enhetsregisteret\n    \n  \n\n"@nb ;
